(246, 17, 10, 'DELETED', 'test', '<figure class=\"single-entry-link\"><img class=\"attachment-viral-mag-800x500 size-viral-mag-800x500 wp-post-image\" src=\"https://slaynews.com/wp-content/uploads/2023/11/coal-plant-collapse-kentucky.jpg\" sizes=\"(max-width: 800px) 100vw, 800px\" srcset=\"https://slaynews.com/wp-content/uploads/2023/11/coal-plant-collapse-kentucky.jpg 800w, https://slaynews.com/wp-content/uploads/2023/11/coal-plant-collapse-kentucky-300x165.jpg 300w, https://slaynews.com/wp-content/uploads/2023/11/coal-plant-collapse-kentucky-768x422.jpg 768w\" alt=\"\" width=\"800\" height=\"440\"></figure>\r\n<div class=\"entry-content\">\r\n<div class=\"code-block code-block-12\">\r\n<div id=\"ld-7356-1678\"></div>\r\n</div>\r\n<p class=\"slay-news-content\">A coal plant has reportedly collapsed in Kentucky, promoting Democrat Gov. Andy Beshear to declare a state of emergency.</p>\r\n<p class=\"slay-news-content\">One worker has died, and a second remains trapped.</p>\r\n<p class=\"slay-news-content\">The plant collapsed Wednesday while workers were inside.</p>\r\n<p class=\"slay-news-content\">Beshear confirmed the incident in a post on Twitter/X.</p>\r\n<p class=\"slay-news-content\">According to the governor, at least one of the workers trapped inside the collapsed coal preparation plant in Martin County has died.</p>\r\n<div class=\"code-block code-block-5\">&nbsp;</div>\r\n<p class=\"slay-news-content\">&ldquo;Please pray for the family and loved ones of this individual,&rdquo; he wrote without elaborating.</p>\r\n<p class=\"slay-news-content\">Citing the Martin County Sheriff&rsquo;s Office, WSAZ/WKYT also confirmed the one death.</p>\r\n<p class=\"slay-news-content\">Beshear had signed an executive order earlier Wednesday declaring a state of emergency in Martin County following the collapse of a coal preparation plant.</p>\r\n<div class=\"code-block code-block-1\">&nbsp;</div>\r\n<p class=\"slay-news-content\">&ldquo;Two workers are trapped inside and a number of teams are working to rescue these individuals,&rdquo; Beshear wrote earlier on X.</p>\r\n<p class=\"slay-news-content\">&ldquo;The Order mobilizes state resources to help.&rdquo;</p>\r\n<p class=\"slay-news-content\">&ldquo;Kentucky, please join Britainy and me in praying for their safety and for the brave teams working to rescue them,&rdquo; the governor added.</p>\r\n</div>', '2023-11-02 16:49:25', NULL, NULL, NULL),
(247, 13, 10, 'NORMAL', 'Connecticut Judge Throws Out Election Results and Orders New Primary After “Shocking” Evidence of Democrat Ballot Fraud', '<div class=\"\"><a href=\"https://theconservativetreehouse.com/blog/2023/11/01/connecticut-judge-throws-out-election-results-and-orders-new-primary-after-shocking-evidence-of-democrat-ballot-fraud/\">\r\n<h1 class=\"font-bold text-primary  text-3xl leading-tight mb-4\">Connecticut Judge Throws Out Election Results and Orders New Primary After &ldquo;Shocking&rdquo; Evidence of Democrat Ballot Fraud</h1>\r\n</a>\r\n<div class=\"post-meta text-sm mb-4 font-serif\"><time datetime=\"2023-11-01T22:27:01-04:00\">November 1, 2023</time>&nbsp;</div>\r\n</div>\r\n<div class=\"post-content font-serif\">\r\n<p>In Bridgeport, Connecticut, State Judge William Clark has thrown out the results of the September Democrat primary election and ordered a new primary to be scheduled and conducted [<a href=\"https://civilinquiry.jud.ct.gov/DocumentInquiry/DocumentInquiry.aspx?DocumentNo=26199518\" target=\"_blank\" rel=\"noopener\">Court Order Here</a>].&nbsp; The issue was ballot harvesting and ballot fraud &ndash; both violations of state law.</p>\r\n<p>The Judge reviewed CCTV footage showing Wanda Geter-Pataky, vice chair of the Bridgeport Democratic Town Committee and operations specialist for the city, and Eneida Martinez, a former City Council member, working to support the party approved candidate.&nbsp; Both Ms Geter-Pataky and Ms Martinez participated in absentee ballot fraud, ballot harvesting and ballot stuffing at drop boxes.&nbsp; &nbsp;Both women invoked the Fifth Amendment when confronted as witnesses by the judge.</p>\r\n<p><a href=\"https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES.jpg\"><img class=\"aligncenter wp-image-239761\" src=\"https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES.jpg\" sizes=\"(max-width: 850px) 100vw, 850px\" srcset=\"https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES.jpg 1166w, https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES-300x105.jpg 300w, https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES-1024x360.jpg 1024w, https://theconservativetreehouse.com/wp-content/uploads/2022/11/bALLOTS-VS-VOTES-768x270.jpg 768w\" alt=\"\" width=\"850\" height=\"299\"></a></p>\r\n<p><em><a href=\"https://ctexaminer.com/2023/11/01/court-overturns-ganim-win-in-bridgeport-primary-calling-evidence-of-fraud-shocking/\" target=\"_blank\" rel=\"noopener\">BRIDGEPORT</a>&nbsp;&ndash; A judge ruled on Wednesday to overturn the city&rsquo;s Democratic primary election, initially won by incumbent Mayor Joe Ganim, following claims of absentee ballot fraud by his opponent, John Gomes.</em></p>\r\n<p><em>After two weeks of evidentiary hearings for Gomes&rsquo;s absentee ballot fraud lawsuit, Judge William Clark ordered a new Democratic primary based on 180 pieces of evidence presented by Gomes&rsquo;s legal counsel.</em></p>\r\n<p><em>In the&nbsp;<a href=\"https://civilinquiry.jud.ct.gov/DocumentInquiry/DocumentInquiry.aspx?DocumentNo=26199518\">37-page ruling</a>, Clark said the video footage presented by Bill Bloss &ndash; Gomes&rsquo;s attorney &ndash; was particularly alarming.</em></p>\r\n<p><span id=\"more-252683\"></span></p>\r\n<p><em>&ldquo;Mr. Ganim was also correct to be &lsquo;shocked&rsquo; at what he saw on the video clips in evidence that were shown to him while he was on the witness stand,&rdquo; Clark wrote. &ldquo;The videos are shocking to the court and should be shocking to all the parties.</em></p>\r\n<p><em>Ganin was one the many city officials called to the Fairfield Judicial District Superior Courthouse for questioning, along with Wanda Geter-Pataky, vice chair of the Bridgeport Democratic Town Committee and operations specialist for the city, and Eneida Martinez, a former City Council member accused by Gomes of stuffing ballot dropboxes.</em></p>\r\n<p><em>At the witness stand, Ganim told the court he was &ldquo;shocked&rdquo; by an&nbsp;<a href=\"https://ctexaminer.com/2023/10/13/new-videos-show-larger-coordinated-activity-against-gomes-in-bridgeport-primary-attorney-says/\">18-minute video</a>&nbsp;&ndash; subpoenaed by Gomes from Bridgeport police &ndash; that appeared to show 12 instances of Geter-Pataky either depositing stacks of ballots herself or handing ballots to others from behind her reception desk, and four instances of Martinez dropping off ballots.</em></p>\r\n<p><em>Asked about the footage during the hearings, both Geter-Pataky and Martinez asserted their Fifth Amendment rights against self-incrimination . Ganim, who appeared to win the primary by 250 votes after a count of absentee ballots,&nbsp;<a href=\"https://ctexaminer.com/2023/10/17/bridgeport-mayor-joe-ganim-denies-involvement-in-alleged-absentee-ballot-fraud/\">denied</a>&nbsp;any involvement in the alleged fraud. (<a href=\"https://ctexaminer.com/2023/11/01/court-overturns-ganim-win-in-bridgeport-primary-calling-evidence-of-fraud-shocking/\" target=\"_blank\" rel=\"noopener\">read more</a>)</em></p>\r\n<p>You don&rsquo;t need to guess the ideology of the ballot harvesting participants.&nbsp; You know.</p>\r\n<p><a href=\"https://theconservativetreehouse.com/wp-content/uploads/2023/11/Screenshot-2023-11-01-222044.png\"><img class=\"aligncenter size-full wp-image-252684\" src=\"https://theconservativetreehouse.com/wp-content/uploads/2023/11/Screenshot-2023-11-01-222044.png\" sizes=\"(max-width: 743px) 100vw, 743px\" srcset=\"https://theconservativetreehouse.com/wp-content/uploads/2023/11/Screenshot-2023-11-01-222044.png 743w, https://theconservativetreehouse.com/wp-content/uploads/2023/11/Screenshot-2023-11-01-222044-300x203.png 300w\" alt=\"\" width=\"743\" height=\"504\"></a><a href=\"https://theconservativetreehouse.com/wp-content/uploads/2023/04/Obama-Ballots.jpg\"><img class=\"aligncenter wp-image-245610\" src=\"https://theconservativetreehouse.com/wp-content/uploads/2023/04/Obama-Ballots.jpg\" sizes=\"(max-width: 740px) 100vw, 740px\" srcset=\"https://theconservativetreehouse.com/wp-content/uploads/2023/04/Obama-Ballots.jpg 704w, https://theconservativetreehouse.com/wp-content/uploads/2023/04/Obama-Ballots-300x178.jpg 300w\" alt=\"\" width=\"740\" height=\"438\"></a></p>\r\n</div>', '2023-11-02 16:52:13', 'uploads/1698945501_6543d9dd54adf.jpg', NULL, NULL),
