(250, 26, 10, 'NORMAL', 'FAA wraps up safety review of SpaceX\'s huge Starship rocket', '<header>\r\n<h1>FAA wraps up safety review of SpaceX\'s huge Starship rocket</h1>\r\n<div class=\"byline-social\">\r\n<div class=\"byline\">\r\n<div id=\"slice-container-authorByline-AS55R8i7dNyxZEk6FLnWQ\" class=\"slice-container slice-author-byline authorByline-AS55R8i7dNyxZEk6FLnWQ slice-container-authorByline\">\r\n<div class=\"author-byline author-byline--basic-layout\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<nav class=\"socialite-widget box less-space \" data-contexturl=\"https://www.space.com/faa-finishes-spacex-starship-safety-review\"></nav></div>\r\n</header>\r\n<section class=\"content-wrapper\">\r\n<div class=\"box less-space hero-image-wrapper\">\r\n<div>\r\n<div class=\"hero-image-padding-wrap padding-on\">\r\n<div class=\"hero-image-padding\"><picture><source class=\" block-image-ads hero-image\" srcset=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-320-80.jpg.webp 320w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-480-80.jpg.webp 480w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-650-80.jpg.webp 650w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-970-80.jpg.webp 970w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1024-80.jpg.webp 1024w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1200-80.jpg.webp 1200w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1920-80.jpg.webp 1920w\" type=\"image/webp\" sizes=\"(min-width: 1000px) 600px, calc(100vw - 40px)\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\"><source class=\" block-image-ads hero-image\" srcset=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-480-80.jpg 480w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-970-80.jpg 970w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1024-80.jpg 1024w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1200-80.jpg 1200w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1920-80.jpg 1920w\" type=\"image/jpeg\" sizes=\"(min-width: 1000px) 600px, calc(100vw - 40px)\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\"><img class=\" block-image-ads hero-image\" src=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-320-80.jpg\" sizes=\"(min-width: 1000px) 600px, calc(100vw - 40px)\" srcset=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-480-80.jpg 480w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-970-80.jpg 970w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1024-80.jpg 1024w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1200-80.jpg 1200w, https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG-1920-80.jpg 1920w\" alt=\"flames shoot from the bottom of a sliver rocket as it rises into a dark blue sky.\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/rEbMmi7xTXnNwVvnLVR3VG.jpg\"></picture></div>\r\n</div>\r\n</div>\r\n<span class=\"caption-text\">SpaceX\'s first fully integrated Starship vehicle rises into the South Texas sky on April 20, 2023.</span>&nbsp;<span class=\"credit\">(Image credit: SpaceX via Twitter)</span></div>\r\n<div class=\"left-rail-area\">&nbsp;</div>\r\n<div id=\"article-body\" class=\"text-copy bodyCopy auto\">\r\n<p>SpaceX\'s giant Starship rocket just cleared a major hurdle on the road to its second-ever liftoff.</p>\r\n<p>The U.S. Federal Aviation Administration (FAA) announced today (Oct. 31) that it has wrapped up its&nbsp;<a href=\"https://www.space.com/spacex-starship-super-heavy.html\" data-before-rewrite-localise=\"https://www.space.com/spacex-starship-super-heavy.html\" data-component-tracked=\"1\">Starship</a>&nbsp;safety review, which assesses the risks that a launch might pose to public health and property.</p>\r\n<aside class=\"hawk-nest hawk-processed\" data-render-type=\"fte\" data-skip=\"dealsy\" data-widget-type=\"seasonal\" data-widget-id=\"86b9041a-4d75-4d55-bede-274afac600fb\" data-result=\"missing\"></aside>\r\n<p>However, there\'s still another regulatory box to check before&nbsp;<a href=\"https://www.space.com/18853-spacex.html\" data-before-rewrite-localise=\"https://www.space.com/18853-spacex.html\" data-component-tracked=\"1\">SpaceX</a>&nbsp;can get a license for the next Starship liftoff.</p>\r\n<p>\"The FAA is continuing to work on the environmental review,\" the agency wrote today in an emailed statement. \"As part of its environmental review, the FAA is consulting with the U.S. Fish and Wildlife Service (USFWS) on an updated Biological Assessment under the Endangered Species Act. The FAA and the USFWS must complete this consultation before the environmental review portion of the license evaluation is completed.\"</p>\r\n<div class=\"jwplayer__widthsetter\">&nbsp;</div>\r\n<p>Starship is the biggest and most powerful rocket ever built. It consists of two fully reusable elements &mdash;&nbsp;the Super Heavy booster and Starship upper stage &mdash;&nbsp;and stands nearly 400 feet (122 meters) tall when fully stacked.</p>\r\n<p>The full-size vehicle has flown just once to date, on a&nbsp;<a href=\"https://www.space.com/spacex-starship-first-space-launch\" data-before-rewrite-localise=\"https://www.space.com/spacex-starship-first-space-launch\" data-component-tracked=\"1\">test flight that launched on April 20</a>&nbsp;from Starbase, SpaceX\'s seaside facility in South Texas.&nbsp;</p>\r\n<p>That mission aimed to send the Starship upper stage partway around the world, with splashdown targeted for the Pacific Ocean near Hawaii. But Starship suffered several problems shortly after liftoff, including a failure of separation for its two stages. As a result, the vehicle was intentionally detonated above the Gulf of Mexico.</p>\r\n<p>The FAA soon initiated a mishap investigation, which&nbsp;<a href=\"https://www.space.com/faa-closes-spacex-starship-mishap-investigation\" data-before-rewrite-localise=\"https://www.space.com/faa-closes-spacex-starship-mishap-investigation\" data-component-tracked=\"1\">closed on Sept. 8</a>. However, the agency stressed at the time that more work was needed before SpaceX could receive a license for liftoff number two.</p>\r\n<p>\"SpaceX must implement all corrective actions that impact public safety and apply for and receive a license modification from the FAA that addresses all safety, environmental and other applicable regulatory requirements prior to the next Starship launch,\" the agency wrote at the time.</p>\r\n<p>And, as today\'s FAA update notes, there\'s still work to do on the environmental side.</p>\r\n<div class=\"fancy-box\">\r\n<div class=\"fancy_box_body\">\r\n<p class=\"fancy-box__body-text\">&nbsp;</p>\r\n</div>\r\n</div>\r\n<p>The ongoing review apparently centers on the&nbsp;<a href=\"https://twitter.com/jeff_foust/status/1717563566515970448\" target=\"_blank\" rel=\"noopener\" data-url=\"https://twitter.com/jeff_foust/status/1717563566515970448\" data-component-tracked=\"1\">potential impacts of a water deluge system</a>, which SpaceX installed beneath Starbase\'s orbital launch mount after the April test flight.&nbsp;</p>\r\n<p>The&nbsp;<a href=\"https://www.space.com/spacex-starship-water-deluge-system-first-test-video\" data-before-rewrite-localise=\"https://www.space.com/spacex-starship-water-deluge-system-first-test-video\" data-component-tracked=\"1\">new system</a>&nbsp;is designed to protect the mount from the destructive power of Super Heavy\'s 33 Raptor engines, which was on full display on April 20: The Raptors blasted out a&nbsp;<a href=\"https://www.space.com/spacex-starship-damage-starbase-launch-pad\" data-before-rewrite-localise=\"https://www.space.com/spacex-starship-damage-starbase-launch-pad\" data-component-tracked=\"1\">big crater beneath the mount</a>, sending chunks of concrete and other debris raining down on Starbase and the surrounding area.</p>\r\n<p>We should expect Starship to fly relatively soon after the environmental review wraps up, provided everything goes well. SpaceX and its founder and CEO,&nbsp;<a href=\"https://www.space.com/18849-elon-musk.html\" data-before-rewrite-localise=\"https://www.space.com/18849-elon-musk.html\" data-component-tracked=\"1\">Elon Musk</a>, have said that the latest vehicle has passed all of its prelaunch tests and is&nbsp;<a href=\"https://twitter.com/SpaceX/status/1716979627154149710\" target=\"_blank\" rel=\"noopener\" data-url=\"https://twitter.com/SpaceX/status/1716979627154149710\" data-component-tracked=\"1\">ready to go</a>.</p>\r\n</div>\r\n</section>', '2023-11-02 17:32:33', 'uploads/1698946353_6543dd310a6e6.png', NULL, 'url'),
