(254, 13, 10, 'NORMAL', '\"...is this why Jack Smith can\'t and won\'t indict President Trump for insurrection?\"', '<iframe src=\"https://rumble.com/embed/v3qr6l7/?pub=4\" width=\"50%\" height=\"600px\">https://rumble.com/embed/v3qr6l7/?pub=4</iframe><a href=\"https://rumble.com/embed/v3qr6l7/?pub=4\" target=\"_blank\">https://rumble.com/embed/v3qr6l7/?pub=4</a>', '2023-11-03 14:30:46', NULL, NULL, NULL),
(255, 13, 10, 'NORMAL', 'NEWS Trump’s legal team drops its biggest bombshell yet, right on Jack Smith’s head…', '<div class=\"article-header\">\r\n<h3 class=\"category\">NEWS</h3>\r\n<h1 class=\"title\">Trump&rsquo;s legal team drops its biggest bombshell yet, right on Jack Smith&rsquo;s head&hellip;</h1>\r\n<div class=\"article-byline\">\r\n<div class=\"meta-data\">\r\n<p><span class=\"date\"><time class=\"date\" datetime=\"2023-11-03\">November 3, 2023</time>&nbsp;(16 hours ago)</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"image-block\">&nbsp;</div>\r\n<div class=\"post\">\r\n<div class=\"content\">\r\n<div class=\"text article-body font-default font-size-med\">\r\n<p>&nbsp;</p>\r\n<hr>\r\n<p>President Trump and his legal team have taken a bold step against Jack Smith and his team with some explosive new developments. Trump&rsquo;s attorney claims to possess evidence suggesting the Biden White House is deeply embroiled in the political persecution of Trump. For anyone who&rsquo;s been following the developments, even minimally, the situation is fishy, and we all know something smells off.</p>\r\n<p>As a matter of fact, at the end of August, the House voiced their worries about the partisan direction of this political witch hunt.</p>\r\n<p><a href=\"https://judiciary.house.gov/media/press-releases/republicans-launch-inquiry-jack-smiths-office-meeting-biden-white-house\">House Judiciary Committee:</a></p>\r\n<blockquote>\r\n<p>&nbsp;Today, House Judiciary Committee Chairman Jim Jordan (R-OH) sent&nbsp;letters&nbsp;to President Biden&rsquo;s Chief of Staff&nbsp;Jeff Zients&nbsp;and&nbsp;Attorney General Merrick Garland&nbsp;on&nbsp;recent reports that Jay Bratt, a top aide to Special Counsel Jack Smith, met with Biden White House officials numerous times. The alleged relationship between Bratt and the Biden White House&nbsp;reinforces the perception that Smith&rsquo;s pursuit of President Trump&nbsp;is not an impartial and unprejudiced investigation.</p>\r\n<p>Excerpts of the letter to Jeff Zients:</p>\r\n<p>&ldquo;The Committee on the Judiciary is continuing its oversight of the Biden Justice Department&rsquo;s commitment to impartial justice and its handling of a special counsel investigation against President Biden&rsquo;s chief opponent in the upcoming presidential election. According to recent reporting, Jay Bratt&mdash;a Department of Justice employee and top aide to Special Counsel Jack Smith&mdash;met with White House officials multiple times, just weeks before Mr. Smith indicted former President Donald Trump. This new information raises serious concerns regarding the potential for a coordinated effort between the Department and the White House to investigate and prosecute President Biden&rsquo;s political opponents.</p>\r\n<p>&ldquo;In September 2021, Mr. Bratt reportedly met with an advisor to the White House Chief of Staff. Two months later, in November 2021, Mr. Bratt again went to the White House to meet with Administration officials. During this same period, President Trump&rsquo;s lawyers were negotiating with the National Archives about presidential records from his tenure in office. According to reporting,&nbsp; Mr. Bratt&rsquo;s 2021 White House meetings related to &lsquo;national security.&rsquo; Subsequently, on March 31, 2023, just nine weeks prior to Mr. Smith&rsquo;s indictment of President Trump, Mr. Bratt met with the White House Counsel&rsquo;s Office Deputy Chief of Staff Caroline Saba and FBI Special Agent Danielle Ray for a &lsquo;case-related interview.&rsquo;</p>\r\n<p>&ldquo;We have previously raised concerns about Mr. Bratt&rsquo;s involvement in this matter, which you have declined to address to date. Mr. Bratt is alleged to have improperly pressured a lawyer representing an employee of President Trump to induce the lawyer&rsquo;s client to cooperate with the Department&rsquo;s prosecution. Mr. Bratt allegedly commented to the lawyer that he did not think the lawyer was a &lsquo;Trump guy&rsquo; and that &lsquo;he would do the right thing.&rsquo; Mr. Bratt referenced the lawyer&rsquo;s application for a judgeship on the D.C. Superior Court and implied that the application would be received more favorably if his client cooperated with the prosecution of President Trump.</p>\r\n<p>&ldquo;These facts reinforce the serious concern that Mr. Smith is not running an impartial and unprejudiced investigation and prosecution. The Committee has a significant interest in examining how the Department runs its Special Counsel investigations to inform potential legislative reforms concerning the Department&rsquo;s Special Counsel practices and operations.</p>\r\n</blockquote>\r\n<p>However, the stakes have just escalated with President Trump&rsquo;s most recent legal maneuver.</p>\r\n<p>His attorneys claim they have proof of collusion between Biden&rsquo;s regime and entities like the National Archives and Records Administration, the Department of Justice, and intelligence agencies in deciding which documents should be in the indictment pursued by Jack Smith.</p>\r\n<div class=\"twitter-tweet twitter-tweet-rendered\"><iframe id=\"twitter-widget-0\" class=\"\" title=\"Twitter Tweet\" src=\"https://platform.twitter.com/embed/Tweet.html?dnt=true&amp;embedId=twitter-widget-0&amp;%3D%3D&amp;frame=false&amp;hideCard=false&amp;hideThread=false&amp;id=1719792546686103740&amp;lang=en&amp;origin=https%3A%2F%2Frevolver.news%2F2023%2F11%2Ftrump-legal-team-drops-biggest-bombshell-yet-right-on-jack-smith%2F&amp;sessionId=fd0911c0aacf11d51eae70bbdd2c8c1d1edd56e9&amp;theme=light&amp;widgetsVersion=01917f4d1d4cb%3A1696883169554&amp;width=500px\" frameborder=\"0\" scrolling=\"no\" allowfullscreen=\"allowfullscreen\" data-tweet-id=\"1719792546686103740\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>Unfortunately, the corruption in this current regime doesn&rsquo;t shock us anymore. They have weaponized and politicized every facet of power with brazen disregard and disrespect for we, the people.</p>\r\n<p>The allegations from Trump&rsquo;s legal team are explosive. This is &ldquo;bombshell&rdquo; type stuff. What continues to astonish many of us is the blatant, coordinated effort to interfere in elections, all while mainstream media outlets, including Fox News, seem to merely observe the spectacle, doing absolutely nothing to actually look into it.</p>\r\n</div>\r\n</div>\r\n</div>', '2023-11-03 19:49:00', 'uploads/1699040940_65454eac60e9e.jpg', NULL, 'url'),
