(289, 14, 10, 'NORMAL', '2023 NFL Power Rankings, Week 11', '<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">As messy as the&nbsp;<a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl\" target=\"_blank\" rel=\"noopener\">NFL</a>&nbsp;hierarchy looks right now, we can count on some turmoil in the coming days.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">There might only be a few games between winning teams this coming weekend, but those few games carry big consequences. There are two huge matchups in the AFC North, where everyone has a winning record. Two of the longest win streaks in the league face off &mdash; in&nbsp;<a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/week-11-minnesota-vikings-vs-denver-broncos-nov-19-2023-game-boxscore-10260\" target=\"_blank\" rel=\"noopener\">the Minnesota-Denver game</a>, of all places.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">And oh, by the way, the top two teams in this week\'s power rankings square off next Monday night in a Super Bowl rematch.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">Let\'s get into the Week 11 rankings now:</p>\r\n<h2 class=\"mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: FANtastic-FOX-Cond; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; outline: 0px;\" data-v-0391f4a3=\"\">NFL Power Rankings</h2>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">1.&nbsp;</span><a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/philadelphia-eagles-team\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">Philadelphia Eagles</span></a><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">&nbsp;(8-1) no change</span></p>\r\n<div class=\"taboola-wrapper mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: FANtastic-FOX-Cond; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline;\" data-v-0391f4a3=\"\">\r\n<div id=\"taboola-reco-reel-mid-article-thumbnails\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"></div>\r\n</div>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">Baltimore&rsquo;s loss in Week 10 further emphasizes how hard it is to stay consistent in this league. It hasn&rsquo;t always been perfect, but the Eagles have been more stable than any other team all season long. With the schedule that&rsquo;s ahead of them after the bye, they can&rsquo;t afford to let up.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">2.&nbsp;</span><a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/kansas-city-chiefs-team\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">Kansas City Chiefs</span></a><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">&nbsp;(7-2) +1</span></p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">Fresh off of each team&rsquo;s bye week, the Chiefs and Eagles meet in a Super Bowl rematch that&rsquo;s also a meeting of the best two teams in the league. On the off chance we aren&rsquo;t giving the Chiefs enough credit, they could change that soon.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">3.&nbsp;</span><a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/baltimore-ravens-team\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">Baltimore Ravens</span></a><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">&nbsp;(7-3) -1</span></p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">I&rsquo;m officially worried about the Ravens&rsquo; ability to close. When they&rsquo;re on, they can blow teams out as well as anyone in the league. But Sunday&rsquo;s loss to Cleveland dropped them to a 3-3 record in one-score games, and they&rsquo;ve surrendered a fourth-quarter lead in all of them. It&rsquo;s not a reason to panic just yet, but I expect a team this good not to squander a 31-17 lead.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">4.&nbsp;</span><a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/detroit-lions-team\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">Detroit Lions</span></a><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">&nbsp;(7-2) +1</span></p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\">The 38-6 loss to Baltimore still feels too fresh for me to bump the Lions over Baltimore, but Detroit just came up with a very nice road win. I can&rsquo;t say enough how much I loved the way Dan Campbell read the situation he was in, realized his defense wasn&rsquo;t getting stops and put the game on his offense. By trusting them to pick up a crucial fourth down, he saved his defense from itself.</p>\r\n<div class=\"delta-video-container mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 20px; border: 1px solid #e5e5e5; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: inherit; font-family: FANtastic-FOX-Cond; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; flex-direction: column; display: flex; border-radius: 4px;\" data-v-12ab472c=\"\" data-v-0391f4a3=\"\">\r\n<h3 class=\"video-title\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px 0px 20px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 20px; line-height: 25px; font-family: FANtastic-FOX; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; outline: 0px; order: 1;\" data-v-12ab472c=\"\">NFL Coaching Spotlight ft. Detroit Lions\' Dan Campbell</h3>\r\n<div class=\"video-player-container\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; position: relative; background-color: #000000; order: 2;\" data-v-12ab472c=\"\">\r\n<div class=\"fs-player-wrapper\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\" data-v-12ab472c=\"\">\r\n<div id=\"video-container-176\" class=\"fs-player\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; height: 340px; width: 605px;\" data-v-12ab472c=\"\">\r\n<div id=\"Video176\" class=\"jwplayer jw-reset jw-state-paused jw-stretch-uniform jw-flag-controls-hidden jw-breakpoint-3 standard-player small-player paused\" style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 16px; line-height: 1em; font-family: Arial, Helvetica, sans-serif; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; position: relative; width: 605px; height: 340px; direction: ltr; color: inherit; background-color: transparent; float: none; list-style: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); min-height: 0px; overflow: hidden; box-sizing: border-box; user-select: none; outline: 0px;\" tabindex=\"0\" role=\"application\" aria-label=\"Video Player\">\r\n<div class=\"jw-wrapper jw-reset\" style=\"-webkit-font-smoothing: antialiased; margin