 against Tennessee snapped a four-game losing streak, and they are still below .500. But they were also the only team in the division that won last week, and it&rsquo;s easy to make the argument that they&rsquo;re the most complete team of the four.</p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v-0391f4a3=\"\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">18.&nbsp;</span><a style=\"-webkit-font-smoothing: antialiased; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #0000ee;\" href=\"https://www.foxsports.com/nfl/indianapolis-colts-team\"><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">Indianapolis Colts</span></a><span style=\"-webkit-font-smoothing: antialiased; font-family: FANtastic-FOX; font-size: 20px; line-height: 1.5;\">&nbsp;(5-5) +5</span></p>\r\n<p class=\"mg-t-b-20 ff-h fs-16 lh-1pt88 mg-t-b-20 article-content\" style=\"-webkit-font-smoothing: antialiased; margin: 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-stretch: inherit; line-height: 1.88; font-family: HaasGrotTextR-55Roman; font-optical-sizing: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; overflow-wrap: break-word;\" data-v